void setupDisplay() {
  Serial.println("Initializing TFT...");
  tft.initR(INITR_BLACKTAB);
  tft.fillScreen(ST7735_BLACK);
  Serial.println("TFT initialized");
}

void displayEmotion(int emotion) {
  tft.setRotation(2);
  Serial.print("Displaying emotion:");
  Serial.println(emotion);
  tft.fillScreen(ST7735_BLACK);
  int16_t x = (tft.width() - 128) / 2;  // Центрирование изображения по горизонтали
  int16_t y = (tft.height() - 128) / 2; // Центрирование изображения по вертикали

  switch (emotion) {
    case 0:
      Serial.println("Displaying: bored");
      tft.drawBitmap(x, y, bored, 128, 128, ST7735_WHITE);
      break;
    case 1:
      Serial.println("Displaying: sad");
      tft.drawBitmap(x, y, sad, 128, 128, ST7735_WHITE);
      break;
    case 2:
      Serial.println("Displaying: angry");
      tft.drawBitmap(x, y, angry, 128, 128, ST7735_RED);
      break;
    case 3:
      Serial.println("Displaying: cute");
      tft.drawBitmap(x, y, cute, 128, 128, ST7735_WHITE);
      break;
    case 4:
      Serial.println("Displaying: stars");
      tft.drawBitmap(x, y, stars, 128, 128, ST7735_YELLOW);
      break;
    case 5:
      Serial.println("Displaying: heart");
      tft.drawBitmap(x, y, heart, 128, 128, ST7735_RED);
      break; 
    case 6:
      Serial.println("Displaying text");
      //tft.setRotation(1);
      tft.setTextSize(2);
      tft.setCursor(x, y);
      tft.print("I LOVE you!");
      break; 
  }
}
